import React from "react";
import "./Definitions.css";

const Definitions = (meanings, word, language, poSpeech) => {
  return <div className="meanings">

      {meanings.map((item) =>
        item.meanings.map((i) =>

          i.definitions.map((def) => <b>{def.definition}</b>)
        )
      )}

    </div>;
};
export default Definitions;
